Insert into OB.OBHOTEL_BOARD (ID,USER_ID,BOARD_TYPE,TITLE,CONTENT,WRITE_DATE,READ_COUNT) values (408,1,1,'싱가폴 특급호텔(미슐랭 3)','싱가폴 특급호텔 

