2) 영어 회화 가능자, 식음료부서 지원자의 경우 영어회화 능통자

3) 관련 전공자 또는 경력자 우대

 

1) 출국후 한국산업인력공단 해외취업성공장려금 200만원 선착순 국비지원(선착순진행)

2016년 9월 싱가포르 특급호텔 3스타 미슐랭 프렌치 레스토랑 정직원을 채용합니다.

프렌치요리의 전설인 Celebrity Chef 조엘 루브숑의 숨겨진 노하우를 통해

자기계발을 하실수 있는 기회입니다.

전 세계 다양한 국가에 오픈되어 고객들의 찬사를 받는 조엘 루브숑과 함께 성장하시기 바랍니다.

자세한 상담을 희망하시는 분들은 이메일로 성함/연락처를 남겨주시면 연락드리고 자세한 상담드리겠습니다. 카카오톡 상담은 HOSKO2012, HOSKO2016로 가능합니다.
',to_date('18/11/18','RR/MM/DD'),0);
